import React from 'react';
import ListContainer from './ejercicio-7/ListContainer.js';

class Ejercicio7 extends React.Component {

    state = {
        todos: [{
            id: 1,
            text: 'Todo 1'
        }]
    }

    render() {
        return (
            <div>
                <h1 className="ejercicio">7. Pintando listas</h1>
                <ListContainer todos={this.state.todos} />
            </div>
        )
    }
}

export default ListContainer;
